import React from "react";
import { Link } from "react-router-dom";
import { Grid, AppBar, Toolbar, Button, Typography } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

const style = makeStyles(theme => ({
    root: { flexGrow: 1 },
    Login: { marginLeft: "auto", marginRight: 0 },
    items: { marginRight: theme.spacing(2) }
}));

function Navbar() {
    const classes = style();

    return (
        <AppBar className={classes.root}>
            <Toolbar>
                <Grid container spacing={3}>
                    <Grid item>
                        <Typography variant="h6" className={classes.items}>
                            <Link to="/" >HOME </Link>
                        </Typography>
                    </Grid>
                    <Grid item>
                        <Typography variant="h6" className={classes.items}>
                            <Link to="/workwithme" > WORK WITH ME </Link>
                        </Typography>
                    </Grid>
                    <Grid item>
                        <Typography variant="h6" className={classes.items}>
                            <Link to="/about" > ABOUT & CONTACT </Link>
                        </Typography>
                    </Grid>
                    <Grid item md={1}>
                        <Button color="inherit">Login</Button>
                    </Grid>
                </Grid>
            </Toolbar>
        </AppBar >
    );
}

export default Navbar;
